-- ----------------------------
-- Table structure for `gen_template`
-- ----------------------------
DROP TABLE IF EXISTS `gen_template`;
CREATE TABLE `gen_template` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '',
  `name` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `category` varchar(2000) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `file_path` varchar(500) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `file_name` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `content` text COLLATE utf8_bin COMMENT '',
  `create_by` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `create_date` datetime DEFAULT NULL COMMENT '',
  `update_by` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `update_date` datetime DEFAULT NULL COMMENT '',
  `remarks` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `del_flag` char(1) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '01',
  PRIMARY KEY (`id`),
  KEY `gen_template_del_falg` (`del_flag`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='';

